DROP TABLE IF EXISTS Gebaeude ;
DROP TABLE IF EXISTS Staedte ;
DROP TABLE IF EXISTS Bundeslaender ;





CREATE TABLE IF NOT EXISTS Bundeslaender (
  BundeslandID INT NOT NULL AUTO_INCREMENT,
  Name VARCHAR(255) NOT NULL,
  ProKopfEnergie Double NULL,
  PRIMARY KEY (BundeslandID)
    );

CREATE TABLE IF NOT EXISTS Staedte (
  StadtID INT NOT NULL AUTO_INCREMENT,
  BundeslandID INT NOT NULL,
  Name VARCHAR(255) NULL,
  Einwohnerzahl INT NOT NULL,
  Gesamtstromverbrauch Double NULL,
  PRIMARY KEY (StadtID),
  
  CONSTRAINT BundeslandID       FOREIGN KEY (BundeslandID)        REFERENCES Bundeslaender (BundeslandID)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION
    );
    
    CREATE TABLE IF NOT EXISTS Gebaeude (
	  GebaeudeID INT NOT NULL AUTO_INCREMENT,
      StadtID INT NOT NULL,
	  name VARCHAR(255) NULL,
      address VARCHAR(255) NULL,
      type VARCHAR(255) NULL,
      modarea Double NULL,
      radabs Double NULL,
      kwh_kwp Double NULL,
      anzahl_0 Double NULL,
      kw_17 Double NULL,
      str_17 Double NULL,
	  PRIMARY KEY (GebaeudeID),
      
	  CONSTRAINT StadtID       FOREIGN KEY (StadtID)        REFERENCES Staedte (StadtID)
		ON DELETE CASCADE
		ON UPDATE NO ACTION
    );
      



	/* INSERTS HERE */



	/* Bundesländer Pro Kopf Energieverbrauch in Gigajoule https://www.statistikportal.de/de/ugrdl/ergebnisse/energie/eev#5858 */

	

	SET SQL_SAFE_UPDATES = 0;
    UPDATE Staedte SET Gesamtstromverbrauch = ((Select ProKopfEnergie from Bundeslaender where Bundeslaender.BundeslandID = Staedte.BundeslandID) * Staedte.Einwohnerzahl);
	SET SQL_SAFE_UPDATES = 1;
    
	commit;